import Head from 'next/head'
import Navbar from './Navbar';

const Layout = (props) => {

    console.log(props)

    return(
    <div>
        <Head>
            <title>Gestor de Creditos</title>
            <link rel="stylesheet"
            href="https://bootswatch.com/4/united/bootstrap.min.css"/>
        </Head>
        {props.index ? <Navbar />: null}

        <div>
            {props.children}
        </div>

    </div>
)}

export default Layout;
